import React from "react";
import "../stylesheets/CharacterDetail.scss";

class CharacterDetail extends React.Component {
  constructor(props) {
    console.log(props);
    // console.log(props.imagedetail);
    // console.log(props.speciesdetail);
    // console.log(props.origindetail);
    super(props);
  }
  render() {
    return (
      <article className={`cardDetail ${this.props.id}`}>
        <h2>{this.props.namedetail.name}</h2>
        <img
          src={this.props.imagedetail.image}
          alt={this.props.imagedetail}
        ></img>
        <p>{this.props.speciesdetail.species}</p>
        <p>{this.props.origindetail.origin}</p>
      </article>
    );
  }
}

CharacterDetail.defaultProps = {};
export default CharacterDetail;
